(defn parse [s]
  (map (fn [l]
         (str/split l #"\s"))
       (str/split-lines s)))

(defn part-1 [in]
  (count (filter (fn [l]
                   (every? (fn [[token c]]
                             (= c 1))
                           (frequencies l)))
                 in)))

(defn tokens->sets [l]
  (map (fn [token]
         (set token))
       l))

(defn part-2 [in]
  (count (filter (fn [l]
                   (every? (fn [[token c]]
                             (= c 1))
                           (frequencies (tokens->sets l))))
                 in)))

(comment
  (part-1 (parse data))
  (part-2 (parse data))
  (count (parse data)))
